import "./Contact.css"

export default function Contact() {
  return (
    <div id="contact">
      <hr/>
        <h1>Contact</h1>

        <p style={{ paddingTop: "25px" }}>Get contact form working so people can send an email to me.</p>
        <p style={{ paddingTop: "15px", color: "red" }}>Note: This form isn't working yet, so if you click submit this won't be sent to me.</p>
    </div>
  );
}
